import React from 'react';
import './progress.scss';
import {Box, useTheme} from '@mui/material'
import { tokens } from '../theme/theme';


export default function Progress() {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  return (
    <Box>
        <Box className='progress__container'>
            <li className='progress__steps'>ERFC
              <span className='steps'>1</span>
            </li>

            <li className='progress__steps'>HSE
              <span className='steps'>2</span>
            </li>

            <li className='progress__steps'>Comm
              <span className='steps'>3</span>
            </li>

            <li className='progress__steps'>SAP
              <span className='steps'>4</span>
            </li>

            <li className='progress__steps'>LOTO
              <span className='steps'>5</span>
            </li>

        </Box>
    </Box>
  )
}
